-- -----------------------------------------------------
-- schema classicmodels
-- -----------------------------------------------------
drop schema if exists lnd CASCADE ;
create schema if not exists lnd;

-- -----------------------------------------------------
-- table {schema}.{table} lnd.offices
-- -----------------------------------------------------
create table if not exists lnd.offices (
	office_code varchar(10) primary key,
	city varchar(50) not null,
	phone varchar(50) not null,
	address_line1 varchar(50) not null,
	address_line2 varchar(50),
	state varchar(50),
	country varchar(50) not null,
	postal_code varchar(15) not null,
	territory varchar(10) not null,
	office_location text not null,
	_sync_date date default current_date
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.employees
-- -----------------------------------------------------
create table if not exists lnd.employees (
  employee_number integer primary key,
  last_name varchar(50) not null,
  first_name varchar(50) not null,
  extension varchar(10) not null,
  email varchar(100) not null,
  reports_to integer,
  job_title varchar(50) not null,
  office_code varchar(10) not null,
  _sync_date date default current_date,
  constraint fk_employees_employees
  	foreign key (reports_to)
	references lnd.employees (employee_number)
	on delete no action
	on update no action,
  constraint fk_employees_offices
  	foreign key (office_code)
	references lnd.offices (office_code)
	on delete no action
	on update no action
);

create index if not exists fk_employees_employees_idx on lnd.employees
(
    reports_to asc
);

create index if not exists fk_employees_offices_idx on lnd.employees
(
    office_code asc
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.customers
-- -----------------------------------------------------
create table if not exists lnd.customers (
  customer_number integer primary key,
  customer_name varchar(50) not null,
  customer_last_name varchar(50) not null,
  customer_first_name varchar(50) not null,
  phone varchar(50) not null,
  address_line1 varchar(50) not null,
  address_line2 varchar(50),
  city varchar(50) not null,
  state varchar(50),
  postal_code varchar(15),
  country varchar(50) not null,
  sales_rep_employee_number integer null,
  credit_limit numeric,
  customer_location text not null,
  _sync_date date default current_date,
  constraint fk_fk_customers_employees
  	foreign key (sales_rep_employee_number)
	references lnd.employees (employee_number)
	on delete no action
	on update no action
);

create index if not exists fk_customers_employees_idx on lnd.customers
(
    sales_rep_employee_number asc
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.product_lines
-- -----------------------------------------------------
create table if not exists lnd.product_lines (
  product_line varchar(50) primary key,
  text_description varchar(4000),
  html_description text,
  image bytea,
  _sync_date date default current_date
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.products
-- -----------------------------------------------------
create table if not exists lnd.products (
  product_code varchar(15) primary key,
  product_name varchar(70) not null,
  product_scale varchar(10) not null,
  product_vendor varchar(50) not null,
  product_description text not null,
  quantity_in_stock smallint not null,
  buy_price numeric not null,
  msrp numeric not null,
  product_line varchar(50) null,
  _sync_date date default current_date,
  constraint fk_products_product_lines
  	foreign key (product_line)
	references lnd.product_lines (product_line)
	on delete no action
	on update no action
);

create index if not exists fk_products_product_lines_idx on lnd.products
(
    product_line asc
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.orders
-- -----------------------------------------------------
create table if not exists lnd.orders (
  order_number integer primary key,
  order_date timestamp not null,
  required_date timestamp not null,
  shipped_date timestamp,
  status varchar(15) not null,
  comments text,
  customer_number integer not null,
  _sync_date date default current_date,
  constraint fk_orders_customers
  	foreign key (customer_number)
	references lnd.customers (customer_number)
	on delete no action
	on update no action
);

create index if not exists fk_orders_customers_idx on lnd.orders
(
    customer_number asc
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.order_details
-- -----------------------------------------------------
create table if not exists lnd.order_details (
  order_number integer not null,
  product_code varchar(15) not null,
  quantity_ordered integer not null,
  price_each numeric not null,
  order_line_number smallint not null,
  _sync_date date default current_date,
  primary key (product_code, order_number),
  constraint fk_order_details_products
  	foreign key (product_code)
	references lnd.products (product_code)
	on delete no action
	on update no action,
  constraint fk_order_details_orders
  	foreign key (order_number)
	references lnd.orders (order_number)
	on delete no action
	on update no action
);

create index if not exists fk_order_details_products_idx on lnd.order_details
(
    product_code asc
);

create index if not exists fk_order_details_orders_idx on lnd.order_details
(
    order_number asc
);

-- -----------------------------------------------------
-- table {schema}.{table} lnd.payments
-- -----------------------------------------------------
create table if not exists lnd.payments (
  check_number varchar(50) primary key,
  payment_date timestamp not null,
  amount numeric not null,
  customer_number integer not null,
  _sync_date date default current_date,
  constraint fk_payments_customers
  	foreign key (customer_number)
	references lnd.customers (customer_number)
	on delete no action
	on update no action
);

create index if not exists fk_payments_customers_idx on lnd.payments
(
    customer_number asc
);

